import React from 'react';

const Footer = () => {
  return (
    <footer>
      <p>Amman, Jordan</p>
      <p>
        <a href="https://github.com/ahmadheresh02" target="_blank" rel="noopener noreferrer">GitHub</a> |
        <a href="https://www.linkedin.com/in/ahmad-alheresh" target="_blank" rel="noopener noreferrer">LinkedIn</a> |
        <a href="mailto:ahmadalheresh7@gmail.com">Mail</a>
      </p>
    </footer>
  );
};

export default Footer;
